ol kar hesaplama secenegini tiklar\r\n    And acilan sayfada kategoriyi secer\r\n    And satis fiyatini yazar\r\n    And hesapla butonuna basar\r\n    Then  gelen sonuclarin dogrulamasini yapar\r\n\r\n  @tc16\r\n  Scenario:TC16\r\n\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And araclar sekmesinde bulunan Etsy sekmesini tiklar\r\n    And Etsy kar hesaplama secenegini tiklar\r\n    And acilan sayfada sadece Turkish Lira secer, satis fiyatını yazar  ve hesapla der\r\n    And  gelen sonuclarin dogrulamasinı yapar\r\n\r\n\r\n  @tc17\r\n  Scenario:TC17\r\n\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And araclar sekmesinde bulunan Etsy sekmesini tiklar\r\n    And Etsy kar hesaplama secenegini tiklar\r\n    And magaza para birimi olarak Turkish Lira secer\r\n    And  vergi numarasi yok\r\n    And  Offsite Ads  %12\r\n    And ucretsiz listeleme var olarak secer\r\n    Then gerekli tüm alanlara satis bilgileri girer\r\n    And  hesapla butonuna tiklar\r\n    And gelen sonuclarin dogrulamsını yapar\r\n\r\n  @tc18\r\n  Scenario:TC18\r\n\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And araclar sekmesinde bulunan Etsy sekmesini tiklar\r\n    And cok satan saticilar sekmesine tiklar\r\n    And acilan sayfada ETSY ÇOK SATAN SATİCİLAR yazisinin geldigini teyit eder\r\n\r\n\r\n  @tc19\r\n  Scenario:TC19\r\n\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And araclar sekmesinde bulunan Etsy sekmesini tiklar\r\n    And cok satan saticilar sekmesine tiklar\r\n    And acilan sayfada gerekli bilgileri  doldurur\r\n    And filtreleri uygula secenegine tiklar\r\n    And Satın al popup geldigini teyit eder dogrular.\r\n\r\ ir adresi girer\r\n    And  gecerli password girer\r\n    And  uretici ve toptancılar sekmesine tıklar\r\n    Then sayfayı aşagı-yukarı kaydırır tüm saticilari görür\r\n    And iletişim kur butonuna tıklar\r\n    And  telefon numarası girer ve doğrulama kodu geldiğini teyit eder\r\n\r\n\r\n  @tc07\r\n  Scenario: TC07\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And  uretici ve toptancılar sekmesine tıklar\r\n    And urunler butonuna tıklar\r\n    Then sayfayı aşagı kaydırır tüm ürünleri görür\r\n    And  iletişim kur butonuna tıklar ve whatsapp'a yönlendirdiğini teyit eder\r\n   # And sayfayı kapatır.\r\n\r\n\r\n  @tc08\r\n  Scenario: TC08\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And  uretici ve toptancılar sekmesine tıklar \r\n    And search butonuna eşofman yazar\r\n    Then ara sekmesine tıklar\r\n    And Mossi isimli firmanın urunleri incele sekmesine tıklar\r\n    And sayfa URL'sinin Mossi isimli firmaya ait olduğunu teyit eder\r\n    Then sayfayı aşagı kaydırıp tüm ürünleri görür\r\n    And ikinci sayfaya gecer tüm ürünleri kontrol eder\r\n    And ucuncu sayfaya gecer tüm urunleri kontrol eder\r\n   # And sayfayı kapatır.\r\n\r\n    @tc09\r\n    Scenario: TC09\r\n      Given kullanıcı members.rexven.com sayfasına gider\r\n      Then  gecerli mail adresi girer\r\n      And  gecerli password girer\r\n      And  uretici ve toptancılar sekmesine tıklar\r\n      Then Uretici veya Toptancı ol sekmesine tıklar\r\n      And acilan sayfada gerekli bilgileri doldurur\r\n      And kayıt ol sekmesine tıklar\r\n      And  Kullanıcı magaza bilgileri gecersiz. Lütfen kontrol ediniz yazısını görür\r\n     # And sayfayı kapatır.\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Ertuğrul/IdeaProjects/Members_Panel/src/test/resources/
